import Comment from "./Comment";

const CommentList = ({ commets }) => {
  return (
    <>
      {CommentList.map(
        (comment) => console.log(comment),
        "list" || <Comment key={comment.id} comment={comment} />
      )}
    </>
  );
};

export default CommentList;
